import React from 'react';
import styles from './NavbarBrand.module.css'
function NavbarBrand(props) {
    return (
        <div className={styles['navbar__brand']}>
            <div>
                Logo
            </div>
            <div className={styles['navbar__close']}>
                <button>
                    
                </button>
            </div>
        </div>
    );
}

export default NavbarBrand;
